def DOMINATION(strategy_array, weeks):
#Used to eliminate dominated strategies in Test()
	breaker = 0
	dominatingstrategies = [strategy_array[0]] #Only the first strategy is in there
	i = 0
	while i < len(strategy_array):
		d = 0
		while d < len(dominatingstrategies):
			j = 0
			addit = 0
			while j < weeks:
				if strategy_array[i][j] > dominatingstrategies[d][j]:
					addit = 1
					break
				j = j+1
			d = d+1
			if addit == 0:
				break
		if addit == 1:
			dominatingstrategies.append(strategy_array[i])
		i = i + 1
	return dominatingstrategies

def FundReturn(lastquarterspend, lastquarterfundraising):
	#Fundraiaing return function
	return (.1124)*lastquarterspend + (1.1057)*lastquarterfundraising

def CreateAllStrategies1(budget, weeks):
	week = 1
	y = budget*1.0
	strategies = []
	strategies2 =[]
	finalstrats = []
	spend = 0
	ifund = 1.0 #TELL TONY WHAT THIS IS
	while spend <= budget:
		strategies.append([spend, y - spend, y*ifund]) #([how much you spend, how much you have left, previous fundraising])
		spend = spend + 1
	week = week + 1
	#We now have an array of every spending strategy for week 1
	while len(strategies[0]) < weeks+1: #Starts week 2, ends week n
		for i in strategies: #i is a strategy vector
			f = FundReturn(i[len(i)-3], i[len(i)-1]) #Extra money we can spend RIGHT NOW
			y =  i[len(i)-2] +  f #remaining budget plus fundraising return
			j = 0 #will cycle through every possible spend amount for this quarter
			while j <= y:
				k = []
				ticker = 0
				while len(k)<len(i)-2:
					k.append(i[ticker])
					ticker = ticker + 1
				k.append(j)
				k.append(y-j)
				k.append(f)
				strategies2.append(k) #Add new strategy to new strategy list
				j = j + 1 #Next spending amount!
		strategies = strategies2 #Should be significantly larger vector
		strategies2 = []
		week = week + 1
	#print "Strategies before:", strategies
	for i in strategies: #Final spend is already in there, get rid of last term
		j = i[:len(i)-2]
		j.append(i[len(i)-1]+i[len(i)-2])
		finalstrats.append(j)
	#print "Strategies after:", finalstrats
	return finalstrats

def Setupmatrix(s1s, s2s, n, p):
	M = [] 
	for i in range(len(s2s)): 
		N = [] 
		for j in range(len(s1s)): 
			payout = 0
			for week in range(n):
				payout = payout + p[week]*(s1s[j][week]-s2s[i][week])
			N.append(payout)
		M.append(N)
	M = [[i for i in a] for a in zip(*M)]
	return M

